import React, { useState, useEffect } from "react"
import '../App.css'
import Table from 'react-bootstrap/Table';


const ShowSelectedRestaurant = () => {

  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  useEffect(() => {
    setLoading(true);
    fetch("http://localhost:8080/restaurant/api/v1/getSelectedRestaurant/1")
      .then((response) => response.json())
      .then((json) => setData(json))
      .finally(() => {
        setLoading(false);
      });
  }, []);

    return (
    <Table striped bordered hover size="sm">
        <thead>
            <tr>
                <th>restaurantName</th>
                 <th>restaurantAddedBy</th>
                 <th>sessionId</th>
            </tr>
        </thead>

        <tbody>
            {
                 <tr key={data.restaurantName}>
                 <td>{data.restaurantName}</td>
                 <td>{data.restaurantAddedBy}</td>
                 <td>{data.sessionId}</td>
               </tr>
            }
        </tbody>
    </Table>);

if(data.statusCode ==200) {
  return (
    <Table striped bordered hover size="sm">
      <thead>
        <tr>
        <tr>
              <th>Email Address</th>
               <th>First Name</th>
               <th>Last Name</th>
          </tr>
        </tr>
      </thead>
      <tbody>
          {data && data.users && data.users.map(user =>
               <tr key={user.emailAddress}>
               <td>{user.emailAddress}</td>
               <td>{user.firstName}</td>
               <td>{user.lastName}</td>
             </tr>
          )}
      </tbody>
    </Table>
  );
} else {
  return (
    <Table striped bordered hover size="sm">
      <thead>
        <tr>
          <th>Message</th>
        </tr>
      </thead>

      <tbody>
        {
          <tr key={data.message}>
            <td>{data.message}</td>
          </tr>
        }
      </tbody>
    </Table>
  );
}
}
export default ShowSelectedRestaurant;
